  constructor(){
    super()

    this.state={
      dt:[]
    }
  }

  call=()=>{
    var b=[]
   var self=this
    axios.get('http://localhost:5000/data')
    .then( (response) =>{
      // handle success
      var a=JSON.stringify(response)

      b=a.split(" ")


      console.log(b);
      self.setState({ dt:b})
      console.log(self.state.dt)


    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .finally(function () {
      // always executed

    });

    self.setState({ dt:b})
   console.log('---------------------')
   console.log(self.state.dt)

  }


  render(){
    return (
      <div>
        <button onClick={()=>this.call()}>submit</button>


      </div>
    )
  }
}
export default App;
